/**
 * provides easy functions to take images, sets up a video and canvas element
 */
export default class Camera {
  /**
   * creates an instance of Camera
   *
   * @param {Object} [mediaOptions={ video: true, audio: false }] - configuration for getUserMedia
   * @param {number} [width=640] - width in pixels for the video element
   */
  constructor(mediaOptions = { video: true, audio: false }, width = 640) {
    const video = document.getElementById('video');
    const canvas = document.getElementById('canvas');

    navigator.mediaDevices.getUserMedia(mediaOptions)
      .then((stream) => {
        video.srcObject = stream;
        video.addEventListener('canplay', this.setResolution.bind(this), false);
        video.play();
      })
      .catch(err => console.error(err));

    /** type {number} */
    this.width = width;
    /** type {Object} */
    this.canvas = canvas;
    /** type {Object} */
    this.video = video;
  }

  /**
   * sets the resolution of both video and canvas element, so that no distortion happens.
   *
   * @return {Object} Object with attributes width and height, calculated.
   */
  setResolution() {
    const { canvas, video, width, setResolution } = this;
    const height = video.videoHeight / (video.videoWidth / width);

    video.setAttribute('width', width);
    video.setAttribute('height', height);
    canvas.setAttribute('width', width);
    canvas.setAttribute('height', height);

    video.removeEventListener('canplay', setResolution);
    return { width, height };
  }

  /**
   * takes an image by drawing the video element's content on the canvas.
   *
   * @return {Object} the canvas element (can be used to access functions such as .toBlob())
   */
  takeImage() {
    const { canvas, video, video: { videoWidth, videoHeight } } = this;
    const context = canvas.getContext('2d');

    context.drawImage(video, 0, 0, videoWidth, videoHeight);
    return canvas;
  }
}

/**
 * Used for accessing Microsoft's Face API. Written for general use cases,
 * not specifically for this application.
 *
 */
export default class FaceAPI {
  /**
   * creates an instance of FaceAPI
   *
   * @param {string} key - API key
   */
  constructor(key) {
    /** type {number} */
    this.key = key;

    // This is done because internally calling functions rebinds "this" wrongly.
    this.makeRequest = this.makeRequest.bind(this);
    //this.getPersonGroupOrCreate = this.getPersonGroupOrCreate.bind(this);
    this.getPersonGroup = this.getPersonGroup.bind(this);
    this.createPersonGroup = this.createPersonGroup.bind(this);
  }

  /** type {string} */
  setKey(key) {
    this.key = key;
  }

  /**
   * makes a request to the API, used for simplifying.
   *
   * @param {string} endpoint - Endpoint to access in request
   * @param {string} [method='GET'] - Method to use for request, e.g. GET, POST, PUT, etc.
   * @param {Object} [headers={ 'Ocp-Apim-Subscription-Key': this.key, 'Content-Type': 'application/json', Accept: 'application/json' }] - Headers to send
   * @param {boolean} [isImage] - If an image is in the body
   * @return {Object} fetch request or error
   */
  makeRequest(endpoint, method = 'GET', body, headers) {
    return fetch(`https://westus.api.cognitive.microsoft.com/face/v1.0/${endpoint}`, {
      body: headers && headers['Content-Type'] === 'application/octet-stream' ? body : JSON.stringify(body),
      headers: Object.assign({ 'Ocp-Apim-Subscription-Key': this.key, 'Content-Type': 'application/json', Accept: 'application/json' }, headers),
      method,
    }).then(response => response.text())
      .then((response) => {
        // Sometimes, the response body is empty, so response.json() fails. This
        // prevents the error from happening by checking if response.text()
        // returns something proper.
        return response !== null ? JSON.parse(response) : {};
      })
      .then((response) => {
        // Catching the error is halting other parts of the class, notably
        // getPersonGroupOrCreate. So we just log it and continue.
        if (response.error) console.error(response.error);

        return response;
      });
  }

  /**
   * fetches a personGroup
   *
   * @param {number} personGroupId
   * @return {Object} fetch request
   */
  getPersonGroup(personGroupId) {
    return this.makeRequest(`persongroups/${personGroupId}`);
  }

  /**
   * creates a personGroup with name identical to the id.
   *
   * @param {string} personGroupId
   * @return {Object} fetch request
   */
  createPersonGroup(personGroupId) {
    return this.makeRequest(`persongroups/${personGroupId}`, 'PUT', {
      name: personGroupId,
    }).then(response => ({
      personGroupId,
      name: personGroupId,
      newlyCreated: true,
      response,
    }));
  }

  /**
   * trains a personGroup
   *
   * @param {string} personGroupId
   * @return {Object} fetch request
   */
  trainPersonGroup(personGroupId) {
    return this.makeRequest(`persongroups/${personGroupId}/train`, 'POST');
  }

  /**
   * checks if personGroup exists and if it doesn't, creates it.
   *
   * @param {string} personGroupId
   * @return {Object} fetch request
   */
  getPersonGroupOrCreate(personGroupId) {
    const { getPersonGroup, createPersonGroup } = this;

    return getPersonGroup(personGroupId)
      .then((response) => {
        // If there was an error (i.e. the group couldn't be found), try creating it.
        if (response.error) return createPersonGroup(personGroupId);

        return response;
      });
  }

  /**
   * create a Person
   *
   * @param {string} personGroupId
   * @param {string} name - Name to display
   * @param {string} [userData] - Secret data
   * @return {Object} fetch request
   */
  createPerson(personGroupId, name, userData) {
    return this.makeRequest(`persongroups/${personGroupId}/persons`, 'POST', {
      name,
      userData,
    }).then(response => ({
      personId: response.personId,
      persistedFaceIds: [],
      name,
      userData,
    }));
  }

  /**
   * deletes a person
   *
   * @param {string} personGroupId
   * @param {string} personId
   * @return {Object} fetch request
   */
  deletePerson(personGroupId, personId) {
    return this.makeRequest(`persongroups/${personGroupId}/persons/${personId}`, 'DELETE');
  }

  /**
   * add a PersonFace to a Person
   *
   * @param {string} personGroupId
   * @param {string} personId
   * @param {Object} image
   * @param {Object} faceRectangle
   * @return {Object} fetch request
   */
  addPersonFace(personGroupId, personId, image, faceRectangle) {
    let faceDimensions;

    if (faceRectangle) {
      const { left, top, width, height } = faceRectangle;
      faceDimensions = `?targetFace=${left},${top},${width},${height}`;
    }

    return this.makeRequest(`persongroups/${personGroupId}/persons/${personId}/persistedFaces${faceDimensions}`, 'POST', image, {
      'Content-Type': 'application/octet-stream',
    });
  }

  /**
   * lists all Persons of a PersonGroup
   *
   * @param {string} personGroupId
   * @return {Object} fetch request
   */
  listPersons(personGroupId) {
    return this.makeRequest(`persongroups/${personGroupId}/persons`);
  }

  /**
   * detects faces in an image
   *
   * @param {blob} image
   * @return {Object} fetch request
   */
  detect(image) {
    let headers;

    if (image && !image.url) {
      headers = {
        'Content-Type': 'application/octet-stream',
      };
    }

    return this.makeRequest('detect?returnFaceId=true&returnFaceAttributes=smile', 'POST', image, headers);
  }

  /**
   * identifies persons from faceIds
   *
   * @param {string} personGroupId
   * @param {string[]} faceIds
   * @return {Object} fetch request
   */
  identify(personGroupId, faceIds) {
    return this.makeRequest('identify', 'POST', {
      personGroupId,
      faceIds,
    });
  }
}

import Vue from 'vue';
import Camera from './camera';
import FaceAPI from './faceapi';

/*
 * This needs to be done so that the styles get compiled.
 * Normally I'd use more components, more layouts, etc. and with this you could
 * very well separate concerns. It's somewhat useless here.
 */
import styles from '../scss/style.scss';

// Suppress linter errors
let faceApi;
let camera;

/*
 * I'm using the Vue.js framework to dynamically update the front-end values and
 * to utilize a simple templating engine.
 *
 * See index.html for the template. All components could be stored in separate
 * files, but I didn't like the way that would have to be structured, so I
 * didn't do it.
 *
 * 'el' is the element used by it.
 *
 * 'data' is like an application state. Changing it makes Vue update the
 * corresponding fields in the HTML template.
 *
 * 'methods' is an object of functions which can be executed, again, from the
 * template.
 */
const app = new Vue({
  el: '#app',
  data: {
    config: {
      key: localStorage.getItem('api-key') || '',
      intervalSpeed: 6000, // the interval's cooldown in milliseconds
    },
    // Possible errors to display status in the front-end
    errors: {
      needTrain: false,
      noneSelected: false,
      noKey: false,
    },
    groupId: localStorage.getItem('person-group-id') || Math.round(Math.random() * 10000).toString(2).substring(0, 32), // TODO: Implement better generation method
    personList: [], // persons in the personGroup
    detectedFaces: [], // currently detected faces
    selectedPerson: null, // currently selected person (for updating)
  },
  methods: {
    // Changes the selected person by index
    setSelectedPerson: (index) => {
      app.errors.noneSelected = false;
      app.selectedPerson = index;
    },
    // Creates a new person based on the front-end form and resets the form
    createPerson: () => {
      faceApi.createPerson(app.groupId, app.$refs.newPersonName.value, null)
        .then(person => app.personList.push(person));

      app.$refs.newPersonName.value = null;
    },
    // Deletes a person
    deletePerson: (index) => {
      faceApi.deletePerson(app.groupId, app.personList[index].personId);
      app.personList.splice(index, 1);
    },
    // Trains the person group
    trainPersonGroup: () => {
      app.errors.needTrain = false;
      faceApi.trainPersonGroup(app.groupId);
    },
    // Add a face to the selected person
    addFaceToPerson: (faceRectangle) => {
      if (app.selectedPerson === null) return app.errors.noneSelected = true;
      app.errors.noneSelected = false;
      app.errors.needTrain = true;

      return camera.takeImage().toBlob(blob =>
        faceApi.addPersonFace(app.groupId, app.personList[app.selectedPerson].personId, blob, faceRectangle),
      );
    },
    // Set the API key to the input's value
    setApiKey: (e) => {
      const key = e.target.value;

      localStorage.setItem('api-key', key);
      faceApi.setKey(key);

      setupPersonGroup();
    },
  },
});

/**
 * Initialize the FaceAPI class used for accessing Microsoft's API.
 * Camera needs to be initialized after Vue.js because it otherwise hijacks the
 * video element.
 */
faceApi = new FaceAPI(app.config.key);
camera = new Camera();

/**
 * Checks whether the key is set.
 * This is a very simple error handler, I would've liked to expand it to also
 * check for other errors.
 */
function checkKey() {
  if (app.config.key.length < 6) {
    app.errors.noKey = true;
    return false;
  }

  app.errors.noKey = false;
  return true;
}

/**
 * Here we're setting up the personGroup.
 * I opted to use one personGroup for each user, as we don't need mulitple for
 * the use case specified. We save the id in the localStorage for persistence.
 * The FaceAPI does support multiple personGroups.
 */
function setupPersonGroup() {
  if (!checkKey()) return;

  faceApi.getPersonGroupOrCreate(app.groupId)
    .then((group) => {
      // If there was an error (most often incorrect api key, reset persons)
      if (group.response && group.response.error) {
        app.personList = [];
        return;
      }

      // save to localStorage
      localStorage.setItem('person-group-id', app.groupId);

      // If the group is not newly created, fetch all existing persons.
      if (!group.newlyCreated) {
        faceApi.listPersons(app.groupId)
          .then((persons) => {
            app.personList = persons;
          });
      }
    });
}

setupPersonGroup();

/**
 * The function detectInImage runs every six seconds, as is restricted by the
 * free rate limit (20 requests per minute, this function does two - detect and
 * identify).
 */
setTimeout(function detectInImage() {
  if (!checkKey()) {
    setTimeout(detectInImage, app.config.intervalSpeed);
    return;
  }

  // Take an image and convert it to a POSTable format (blob)
  camera.takeImage().toBlob((blob) => {
    // Send a request to the API to detect the faces
    faceApi.detect(blob).then((resp) => {
      if (resp.error) return [];

      return resp;
    }).then((faces) => {
      // Identify faces in the detected faces.
      faceApi.identify(app.groupId, faces.map(face => face.faceId))
        .then((response) => {
          // Reset every smiling variable. Smiling doubles as an 'isIdentified' boolean.
          app.personList.forEach((p, i) => delete app.personList[i].smiling);

          // If there was an error, skip the assigning and return originally detected faces.
          if (response.error) return faces;

          // Assign the most likely person's name to the face for displaying
          response.forEach((identifiedFace) => {
            // If the API couldn't find anyone, return.
            if (identifiedFace.candidates.length < 1) return;

            // Find the identified person and then the detected face
            const personIndex = app.personList.findIndex(p =>
              p.personId === identifiedFace.candidates[0].personId);

            const faceIndex = faces.findIndex(f =>
              f.faceId === identifiedFace.faceId);

            const person = app.personList[personIndex];
            const face = faces[faceIndex];

            // If the person couldn't be found, it's likely because it has been
            // deleted before and the API hasn't been retrained.
            if (person) {
              face.identifiedAs = person.name;
              person.smiling = face.faceAttributes.smile;
            } else {
              face.identifiedAs = 'Error. Please train.';
              app.errors.needTrain = true;
            }
          });

          return faces;
        }).then((detectedFaces) => {
          // Finally, display these faces
          app.detectedFaces = detectedFaces;
          // Repeat after 6 seconds, see comment above the initial declaration
          setTimeout(detectInImage, app.config.intervalSpeed);
        });
    });
  });
}, app.config.intervalSpeed);
